import React from "react";
import { aircrafts } from "../../utils/data";
import { Card } from "../Card";

const AircraftList = () => {

    return (
        <>
            {aircrafts.map(aircraft => (
                <Card key={aircraft.ident} >
                    {aircraft.ident}
                </Card>
            )
            )}
        </>
    );
};

export default AircraftList;
